  return (
    <>
      <div className="container">
        <NavBar />
        <Routes>
          <Route path="/" element={<App />}>
            <Route index element={<Home />} />
            <Route index element={<Favourite />} />
            <Route index element={<Contact />} />
            {/* <Route path="/page-one" element={<Favourites />}>
